/// items : [{"kind":"books#volume","id":"mIxQAAAAMAAJ","etag":"cWpm2jHWiH0","selfLink":"https://www.googleapis.com/books/v1/volumes/mIxQAAAAMAAJ","volumeInfo":{"title":"Understanding Programming Languages","authors":["M. Ben-Ari"],"publishedDate":"1996-03-26","description":"This book compares constructs from C with constructs from Ada in terms of levels of abstractions. Studying these languages provides a firm foundation for an extensive examination of object-oriented language support in C++ and Ada 95. It explains what alternatives are available to the language designer, how language constructs should be used in terms of safety and readability, how language constructs are implemented and which ones can be efficiently compiled and the role of language in expressing and enforcing abstractions. The final chapters introduce functional (ML) and logic (Prolog) programming languages to demonstrate that imperative languages are not conceptual necessities for programming.","industryIdentifiers":[{"type":"OTHER","identifier":"UOM:39015037286278"}],"readingModes":{"text":false,"image":false},"pageCount":384,"printType":"BOOK","categories":["Computers"],"maturityRating":"NOT_MATURE","allowAnonLogging":false,"contentVersion":"0.9.6.0.preview.0","panelizationSummary":{"containsEpubBubbles":false,"containsImageBubbles":false},"imageLinks":{"smallThumbnail":"http://books.google.com/books/content?id=mIxQAAAAMAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api","thumbnail":"http://books.google.com/books/content?id=mIxQAAAAMAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api"},"language":"en","previewLink":"http://books.google.com.eg/books?id=mIxQAAAAMAAJ&q=programming&dq=programming&hl=&cd=1&source=gbs_api","infoLink":"http://books.google.com.eg/books?id=mIxQAAAAMAAJ&dq=programming&hl=&source=gbs_api","canonicalVolumeLink":"https://books.google.com/books/about/Understanding_Programming_Languages.html?hl=&id=mIxQAAAAMAAJ"},"saleInfo":{"country":"EG","saleability":"NOT_FOR_SALE","isEbook":false},"accessInfo":{"country":"EG","viewability":"NO_PAGES","embeddable":false,"publicDomain":false,"textToSpeechPermission":"ALLOWED","epub":{"isAvailable":false},"pdf":{"isAvailable":false},"webReaderLink":"http://play.google.com/books/reader?id=mIxQAAAAMAAJ&hl=&source=gbs_api","accessViewStatus":"NONE","quoteSharingAllowed":false},"searchInfo":{"textSnippet":"This book compares constructs from C with constructs from Ada in terms of levels of abstractions."}},{"kind":"books#volume","id":"ZQigDwAAQBAJ","etag":"tdsnKwW/6B4","selfLink":"https://www.googleapis.com/books/v1/volumes/ZQigDwAAQBAJ","volumeInfo":{"title":"Modern Programming: Object Oriented Programming and Best Practices","subtitle":"Deconstruct object-oriented programming and use it with other programming paradigms to build applications","authors":["Graham Lee"],"publisher":"Packt Publishing Ltd","publishedDate":"2019-06-28","description":"Discover the untapped features of object-oriented programming and use it with other software tools to code fast, efficient applications. Key FeaturesExplore the complexities of object-oriented programming (OOP)Discover what OOP can do for youLearn to use the key tools and software engineering practices to support your own programming needsBook Description Your experience and knowledge always influence the approach you take and the tools you use to write your programs. With a sound understanding of how to approach your goal and what software paradigms to use, you can create high-performing applications quickly and efficiently. In this two-part book, you’ll discover the untapped features of object-oriented programming and use it with other software tools to code fast and efficient applications. The first part of the book begins with a discussion on how OOP is used today and moves on to analyze the ideas and problems that OOP doesn’t address. It continues by deconstructing the complexity of OOP, showing you its fundamentally simple core. You’ll see that, by using the distinctive elements of OOP, you can learn to build your applications more easily. The next part of this book talks about acquiring the skills to become a better programmer. You’ll get an overview of how various tools, such as version control and build management, help make your life easier. This book also discusses the pros and cons of other programming paradigms, such as aspect-oriented programming and functional programming, and helps to select the correct approach for your projects. It ends by talking about the philosophy behind designing software and what it means to be a \"good\" developer. By the end of this two-part book, you will have learned that OOP is not always complex, and you will know how you can evolve into a better programmer by learning about ethics, teamwork, and documentation. What you will learnUntangle the complexity of object-oriented programming by breaking it down to its essential building blocksRealize the full potential of OOP to design efficient, maintainable programsUtilize coding best practices, including TDD, pair programming and code reviews, to improve your workUse tools, such as source control and IDEs, to work more efficientlyLearn how to most productively work with other developersBuild your own software development philosophyWho this book is for This book is ideal for programmers who want to understand the philosophy behind creating software and what it means to be “good” at designing software. Programmers who want to deconstruct the OOP paradigm and see how it can be reconstructed in a clear, straightforward way will also find this book useful. To understand the ideas expressed in this book, you must be an experienced programmer who wants to evolve their practice.","industryIdentifiers":[{"type":"ISBN_13","identifier":"9781838986902"},{"type":"ISBN_10","identifier":"1838986901"}],"readingModes":{"text":true,"image":true},"pageCount":266,"printType":"BOOK","categories":["Computers"],"maturityRating":"NOT_MATURE","allowAnonLogg