ustryIdentifiers":[{"type":"OTHER","identifier":"STANFORD:36105019311971"}],"readingModes":{"text":false,"image":false},"pageCount":456,"printType":"BOOK","categories":["Computers"],"maturityRating":"NOT_MATURE","allowAnonLogging":false,"contentVersion":"1.4.3.0.preview.0","panelizationSummary":{"containsEpubBubbles":false,"containsImageBubbles":false},"imageLinks":{"smallThumbnail":"http://books.google.com/books/content?id=wXEZAQAAIAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api","thumbnail":"http://books.google.com/books/content?id=wXEZAQAAIAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api"},"language":"en","previewLink":"http://books.google.com.eg/books?id=wXEZAQAAIAAJ&q=programming&dq=programming&hl=&cd=5&source=gbs_api","infoLink":"http://books.google.com.eg/books?id=wXEZAQAAIAAJ&dq=programming&hl=&source=gbs_api","canonicalVolumeLink":"https://books.google.com/books/about/Programming_Language_Concepts.html?hl=&id=wXEZAQAAIAAJ"},"saleInfo":{"country":"EG","saleability":"NOT_FOR_SALE","isEbook":false},"accessInfo":{"country":"EG","viewability":"NO_PAGES","embeddable":false,"publicDomain":false,"textToSpeechPermission":"ALLOWED","epub":{"isAvailable":false},"pdf":{"isAvailable":false},"webReaderLink":"http://play.google.com/books/reader?id=wXEZAQAAIAAJ&hl=&source=gbs_api","accessViewStatus":"NONE","quoteSharingAllowed":false},"searchInfo":{"textSnippet":"This book explains and illustrates key concepts of programming by taking a breadth approach to programming languages."}},{"kind":"books#volume","id":"s-IH_x6ytuQC","etag":"F8jOaJVC5wE","selfLink":"https://www.googleapis.com/books/v1/volumes/s-IH_x6ytuQC","volumeInfo":{"title":"The C# Programming Language (Covering C# 4.0), Portable Documents","authors":["Anders Hejlsberg","Mads Torgersen","Scott Wiltamuth","Peter Golde"],"publisher":"Addison-Wesley Professional","publishedDate":"2010-10-31","description":"The popular C# programming language combines the high productivity of rapid application development languages with the raw power of C and C++. Updated to cover the new features of C# 4.0, including dynamic binding, named and optional parameters, and covariant and contravariant generic types, this release takes the language to the next level by adding the ability to cleanly write programs that don’t rely on static type definitions. This allows dynamic programming languages such as Python, Ruby, and JavaScript to feel native to C#. The C# Programming Language, Fourth Edition, continues to be the authoritative and annotated technical reference for C# 4.0. 7nbsp; Written by Anders Hejlsberg, the language’s architect, and his colleagues, Mads Torgersen, Scott Wiltamuth, and Peter Golde, this volume has been completely updated for C# 4.0. The book provides the complete specification of the language, along with descriptions, reference materials, code samples, and annotations from twelve prominent C# gurus. The many annotations bring a depth and breadth of understanding rarely found in any programming book. As the main text of the book introduces the concepts of the C# language, cogent annotations explain why they are important, how they are used, how they relate to other languages, and even how they evolved. This book is the definitive, must-have reference for any developer who wants to understand C#. With annotations from: Brad Abrams, Joseph Albahari, Krzysztof Cwalina, Jesse Liberty, Eric Lippert, Christian Nagel, Vladimir Reshetnikov, Marek Safar, Chris Sells, Peter Sestoft, Jon Skeet, and Bill Wagner.","industryIdentifiers":[{"type":"ISBN_13","identifier":"9780132481724"},{"type":"ISBN_10","identifier":"0132481723"}],"readingModes":{"text":true,"image":true},"pageCount":1072,"printType":"BOOK","categories":["Computers"],"maturityRating":"NOT_MATURE","allowAnonLogging":true,"contentVersion":"1.10.8.0.preview.3","panelizationSummary":{"containsEpubBubbles":false,"containsImageBubbles":false},"imageLinks":{"smallThumbnail":"http://books.google.com/books/content?id=s-IH_x6