reference is organized by function, with a road map-style alphabetical reference for quick access of information about all aspects of running and administering the program. The CD-ROM contains Windows and Linux Python distributions plus extensive cross-platform source code from the book.","industryIdentifiers":[{"type":"ISBN_13","identifier":"9780130260369"},{"type":"ISBN_10","identifier":"0130260363"}],"readingModes":{"text":false,"image":true},"pageCount":805,"printType":"BOOK","categories":["Computers"],"averageRating":3.5,"ratingsCount":12,"maturityRating":"NOT_MATURE","allowAnonLogging":false,"contentVersion":"0.3.2.0.preview.1","panelizationSummary":{"containsEpubBubbles":false,"containsImageBubbles":false},"imageLinks":{"smallThumbnail":"http://books.google.com/books/content?id=mh0bU6NXrBgC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","thumbnail":"http://books.google.com/books/content?id=mh0bU6NXrBgC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api"},"language":"en","previewLink":"http://books.google.com.eg/books?id=mh0bU6NXrBgC&printsec=frontcover&dq=programming&hl=&cd=7&source=gbs_api","infoLink":"http://books.google.com.eg/books?id=mh0bU6NXrBgC&dq=programming&hl=&source=gbs_api","canonicalVolumeLink":"https://books.google.com/books/about/Core_Python_Programming.html?hl=&id=mh0bU6NXrBgC"},"saleInfo":{"country":"EG","saleability":"NOT_FOR_SALE","isEbook":false},"accessInfo":{"country":"EG","viewability":"PARTIAL","embeddable":true,"publicDomain":false,"textToSpeechPermission":"ALLOWED_FOR_ACCESSIBILITY","epub":{"isAvailable":false},"pdf":{"isAvailable":false},"webReaderLink":"http://play.google.com/books/reader?id=mh0bU6NXrBgC&hl=&source=gbs_api","accessViewStatus":"SAMPLE","quoteSharingAllowed":false},"searchInfo":{"textSnippet":"The CD-ROM contains Windows and Linux Python distributions plus extensive cross-platform source code from the book."}},{"kind":"books#volume","id":"YXQsDwAAQBAJ","etag":"Dfc1cIMJXJ4","selfLink":"https://www.googleapis.com/books/v1/volumes/YXQsDwAAQBAJ","volumeInfo":{"title":"Coding Literacy","subtitle":"How Computer Programming Is Changing Writing","authors":["Annette Vee"],"publisher":"MIT Press","publishedDate":"2017-07-28","description":"How the theoretical tools of literacy help us understand programming in its historical, social and conceptual contexts. The message from educators, the tech community, and even politicians is clear: everyone should learn to code. To emphasize the universality and importance of computer programming, promoters of coding for everyone often invoke the concept of “literacy,” drawing parallels between reading and writing code and reading and writing text. In this book, Annette Vee examines the coding-as-literacy analogy and argues that it can be an apt rhetorical frame. The theoretical tools of literacy help us understand programming beyond a technical level, and in its historical, social, and conceptual contexts. Viewing programming from the perspective of literacy and literacy from the perspective of programming, she argues, shifts our understandings of both. Computer programming becomes part of an array of communication skills important in everyday life, and literacy, augmented by programming, becomes more capacious. Vee examines the ways that programming is linked with literacy in coding literacy campaigns, considering the ideologies that accompany this coupling, and she looks at how both writing and programming encode and distribute information. She explores historical parallels between writing and programming, using the evolution of mass textual literacy to shed light on the trajectory of code from military and government infrastructure to large-scale businesses to personal use. Writing and coding were institutionalized, domesticated, and then established as a basis for literacy. Just as societies demonstrated a “literate mentality” regardless of the literate status of individuals, Vee argues, a “computational mentality” is now emerging even though coding is still a specialized skill.","industryIdentifiers":[{"type":"ISBN_13","identifier":"9780262036245"},{"type":"ISBN_10","identifier":"026203624X"}],"readingModes":{"text":false,"image":true},"pageCount":375,"printType":"BOOK","categories":["Computers"],"maturityRating":"NOT_MATURE","allowAnonLogging":false,"contentVersion":"1.3.3.0.preview.1","panelizationSummary":{"containsEpubBubbles":false,"containsImageBubbles":false},"imageLinks":{"smallThumbnail":"http://books.google.com/books/content?id=YXQsDwAAQBAJ&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","thumbnail":"http://books.google.com/books/content?id=YXQsDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api"},"language":"en","previewLink":"http://books.google.com.eg/books?id=YXQsDwAAQBAJ&printsec=frontcover&dq=programming&hl=&cd=8&source=gbs_api","infoLink":"http://books.google.com.eg/books?id=YXQsDwAAQBAJ&dq=programming&hl=&source=gbs_api","canonicalVolumeLink":"https://books.google.com/books/about/Coding_Literacy.html?hl=&id=YXQsDwAAQBAJ"},"saleInfo":{"country":"EG","saleability":"NOT_FOR_SALE","isEbook":false},"accessInfo":{"country":"EG","viewability":"PARTIAL","embeddable":true,"publicDomain":false,"textToSpeechPermission":"ALLOWED","epub":{"isAvailable":false},"pdf":{"isAvailable":true,"acsTokenLink":"http://books.google.com.eg/books/download/Coding_Literacy-sample-pdf.acsm?id=YXQsDwAAQBAJ&format=pdf&output=acs4_fulfillment_token&dl_type=sample&source=gbs_api"},"webReaderLink":"http://play.google.com/books/reader?id=YXQsDwAAQBAJ&hl=&source=gbs_api","accessViewStatus":"SAMPLE","quoteSharingAllowed":false},"searchInfo":{"textSnippet":"In this book, Annette Vee examines the coding-as-literacy analogy and argues that it can be an apt rhetorical frame."}},{"kind":"books#volume","id":"u13hVoYVZa8C","etag":"g6N50msus2o","selfLink":"https://www.googleapis.com/books/v1/volumes/u13hVoYVZa8C","volumeInfo":{"title":"Planning Extreme Programming","authors":["Kent Beck","Martin Fowler"],"publisher":"Addison-Wesley Professional","publishedDate":"2001","description":"Without careful ongoing planning, the software development process can fall apart. Extreme Programming (XP) is a new programming discipline, or methodology, that is geared toward the way that the vast majority of software development projects are handled -- in small teams. In this new book, noted software engineers Kent Beck and Martin Fowler show the reader how to properly plan a software development project with XP in mind. The authors lay out a proven strategy that forces the reader to plan as their software project unfolds, and therefore avoid many of the nasty problems that can potentially spring up along the way.","industryIdentifiers":[{"type":"ISBN_10","identifier":"0201710919"},{"type":"ISBN_13","identifier":"9780201710915"}],"readingModes":{"text":false,"image":true},"pageCount":162,"printType":"BOOK","categories":["Computers"],"averageRating":4,"ratingsCount":6,"maturityRating":"NOT_MATURE","allowAnonLogging":false,"contentVersion":"0.3.4.0.preview.1","panelizationSummary":{"containsEpubBubbles":false,"containsImageBubbles":false},"imageLinks":{"smallThumbnail":"http://books.google.com/books/content?id=u13hVoYVZa8C&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api","thumbnail":"http://books.google.com/books/content?id=u13hVoYVZa8C&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api"},"language":"en","previewLink":"http://books.google.com.eg/books?id=u13hVoYVZa8C&printsec=frontcover&dq=programming&hl=&cd=9&source=gbs_api","infoLink":"http://books.google.com.eg/books?id=u13hVoYVZa8C&dq=programming&hl=&source=gbs_api","canonicalVolumeLink":"https://books.google.com/books/about/Planning_Extreme_Programming.html?hl=&id=u13hVoYVZa8C"},"saleInfo":{"country":"EG","saleability":"NOT_FOR_SALE","isEbook":false},"accessInfo":{"country":"EG","viewability":"PARTIAL","embeddable":true,"publicDomain":false,"textToSpeechPermission":"ALLOWED_FOR_ACCESSIBILITY","epu